notes.body:
@Madeleine Penales this lead looks motivated/urgent. Connect with him and get an understanding of their timing and urgency. 

May not be a candidate for a 120-day close due to the notes mention of urgency. If he's open to waiting, I think we can do a MAO of $185k.

If he wants us to buy it quickly MAO is going to be $151k and need 45 days DD.

@Dante Hernandez you need to dial the main mobile number that Iris texted ending in 0956. 

Look at comps on this one. Filter everything above 80 acres in the county. There's a lot of listed on-market competition at $2,500 an acre. She has a nice property, but I have a hard time thinking she would get any more than $3,000 an acre for it. And I wouldn't be surprised if she got less due to the competition on the market. I really like this property from a subdivide potential. If we could cut it into 40 to 60 acre tracks, I think the price per acre could be driven up to $5,000 to $6,000 an acre. Making it compelling for us to pursue. 

Engage this lead and start to build a relationship. Big deal potential. See if you can gain some trust talking about the comps you see in the area. Don't tell her she's wrong but nicely imply that what you see on the market makes you question whether or not she would get $1.5M on the market.
